description:
Jeunes Veuves Lubriques (Christoph Clark, Video Marc Dorcel / 1995)

As two young and good looking widowers recall their past sexual life, they are convinced that their husbands were fickled ones and that they had themselves the &quot;know how&quot; to take revenge on them in over-using of all virilities passing nearby.

Erika Bella, Christophe Clark, Clarissa Bruni, Mike Foster, Anika Kope, Andrea Nobilli, David Perry, Isolt Walson

All Sex

